description:
If her husband's crazy for wanting to watch, what does that make you?A state mental facility has gone into complete chaos. The patients are running amuck and the electric shock machine has broken down once again. The doctor in charge has become quite desperate. Bordering on complete and utter panic, he allows Nurse Snatch-it to implement a very controversial therapy. The treatment has remarkable results for the patients and raises staff moral as well!

